# the mentee, sample clusters generated by the make_blobs
import numpy as np
import pandas as pd
from matplotlib import pyplot as plt
from sklearn.datasets import make_blobs
from sklearn.cluster import KMeans

# + [markdown] id="oIqxPcqUP2iv"
# Assuming mentee clusters shown as the following:

# + colab={"base_uri": "https://localhost:8080/", "height": 283} id="EC23XoXGLQlQ" outputId="7615fa40-7377-4b1f-fec6-d1ee5d997a9c"
X, y = make_blobs(n_samples=300, centers=4, cluster_std=0.60, random_state=0)
plt.scatter(X[:,0], X[:,1])

# + [markdown] id="eRfSrfbzP0V4"
# Then use the elbow method. To get the values used in the graph, we train multiple models using a different number of clusters and storing the value of the intertia_ property (WCSS) every time.

# + colab={"base_uri": "https://localhost:8080/", "height": 294} id="os1HoidXLTYm" outputId="faab964d-bdd7-41d4-84e1-be250180d88a"
wcss = []
for i in range(1, 11):
    kmeans = KMeans(n_clusters=i, init='k-means++', max_iter=300, n_init=10, random_state=0)
    kmeans.fit(X)
    wcss.append(kmeans.inertia_)
plt.plot(range(1, 11), wcss)
plt.title('Elbow Method')
plt.xlabel('Number of clusters')
plt.ylabel('WCSS')
plt.show()

# + [markdown] id="onHUsu_yRQRP"
# Next, weâ€™ll categorize the data using the optimum number of clusters (4), as 4 mentee clusters, determined in the last step. k-means++ ensures not to fall into the random initialization trap. Each center red dot, representing a mentor in each mentee cluster and that makes the mentor-mentee match.

# + colab={"base_uri": "https://localhost:8080/", "height": 264} id="STbUqxdoLX3-" outputId="f92f5442-e3ff-4d08-cc0c-2408668824f8"
kmeans = KMeans(n_clusters=4, init='k-means++', max_iter=300, n_init=10, random_state=0)
pred_y = kmeans.fit_predict(X)
plt.scatter(X[:,0], X[:,1])
plt.scatter(kmeans.cluster_centers_[:, 0], kmeans.cluster_centers_[:, 1], s=300, c='red')
plt.show()

